import React from "react";
import { useParams } from "react-router-dom";

const CategoryPage = ({ match }) => {
  const { category } = useParams();
  alert(category);
  return (
    <div>
      <h2>Category Page</h2>
    </div>
  );
};

export default CategoryPage;
